	/**
	 * 文件删除
	 *
	 * @param autoClearDay 文件保存天数
	 */
	public void clearLog(String PATH, int autoClearDay) {
		File dirFile = new File(PATH);
		if (dirFile.exists()) {
			autoClearDay = autoClearDay < 0 ? 0 : autoClearDay;
			long thisTime = DateUtil.getTime();
			List<String> fileUrlList = FileUtil.readFileAndPath(PATH, true, null);
			if (fileUrlList != null && fileUrlList.size() > 0) {
				File thisFile = null;
				for (String fileUrl : fileUrlList) {
					thisFile = new File(fileUrl);
					long lastModified = thisFile.lastModified();
					//相差天数
					long day = (thisTime - lastModified) / DateUtil.DAY_MILLI;
					if (day > autoClearDay) {
						System.out.println("remove:" + thisFile.getAbsolutePath() + ",day:" + day);
						//FileUtil.removeFile(thisFile);
					}
				}
			}
		}
	}

	/**
	 * 给定字符串J 代表石头中宝石的类型，和字符串 S代表你拥有的石头。 S 中每个字符代表了一种你拥有的石头的类型，你想知道你拥有的石头中有多少是宝石。
	 * J 中的字母不重复，J 和 S中的所有字符都是字母。字母区分大小写，因此"a"和"A"是不同类型的石头。
	 */
	@Test
	public void testbSsT() {
		String j = "aA", s = "aAAbbbb";
		String[] split = j.split("");
		Map<String, Integer> map = new HashMap<>();
		for (String s1 : split) {
			map.put(s1, 0);
		}
		String[] split1 = s.split("");
		int size = 0;
		for (String s1 : split1) {
			if (map.containsKey(s1)) {
				//Integer integer = map.get(s1) + 1;
				//map.put(s1, integer);
				size++;
			}
		}
		for (Map.Entry<String, Integer> stringIntegerEntry : map.entrySet()) {

			System.out.println("key:" + stringIntegerEntry.getKey() + ",value:" + stringIntegerEntry.getValue());
		}
		System.out.println("map:size:" + size);
		size = 0;
		Set<Character> charSet = new HashSet<>();
		for (int i = 0, let = j.length(); i < let; i++) {
			charSet.add(j.charAt(i));
		}
		for (int i = 0, let = s.length(); i < let; i++) {
			if (charSet.contains(s.charAt(i))) {
				size++;
			}
		}
		System.out.println("set:size:" + size);
	}

	@Test
	public void testObjIsEmpty() {
		HashMap<Object, Object> hashMap = new HashMap<>();
		hashMap.put("lalal", 1);
		LinkedHashMap<Object, Object> linkedHashMap = new LinkedHashMap<>();
		linkedHashMap.put("lalal", 1);
		ArrayList<Object> arrayList = new ArrayList<>();
		arrayList.add("aaa");

		System.out.println("HashMap:" + ObjectUtil.isNotEmptyObj(hashMap));
		System.out.println("linkedHashMap:" + ObjectUtil.isNotEmptyObj(linkedHashMap));
		System.out.println("arrayList:" + ObjectUtil.isNotEmptyObj(arrayList));

		String[] stringArr = {"10"};
		int[] intArr = {};
		Integer[] integerArr = new Integer[10];
		System.out.println("stringArr:" + ObjectUtil.isNotEmptyObj(stringArr));
		System.out.println("intArr:" + ObjectUtil.isNotEmptyObj(intArr));
		System.out.println("integerArr:" + ObjectUtil.isNotEmptyObj(integerArr));
		UserInfo userInfo = new UserInfo();
		System.out.println("userInfo:" + ObjectUtil.isNotEmptyObj(userInfo));
		System.out.println("string:" + ObjectUtil.isNotEmptyObj("123654"));
		System.out.println("int:" + ObjectUtil.isNotEmptyObj(123));
		System.out.println("defaultIfNull(null,123)" + ObjectUtil.defaultIfNull(null, 123));
	}

